import React from 'react';
import './App.css';

function App() {
  return (
    <div className="app">
      <section className="connectivity-centre">
        {/* Content for connectivity centre */}
      </section>

      <section className="independent-hotels">
        <h2>Independent hotels</h2>
        <p>Connect with us directly, or through one of our certified channel managers or technology partners.</p>
        {/* Add more content and images */}
        <button>View API documentation</button>
      </section>

      <section className="hotel-chains">
        <h2>Hotel chains</h2>
        <p>We offer a range of solutions for hotel chains, including direct connections and certified channel managers. Our dedicated team will work with you to develop a custom solution that meets your needs.</p>
        {/* Add more content and images */}
        <button>Contact us</button>
        <button>Partnership inquiries</button>
      </section>
    </div>
  );
}

export default App;
